import './Header.css';

function Header() {
  return (
    <div className="Header">
        <div id='container'>
            <div id="Title">
                
                <h2>Title</h2>
            </div>
            <div id="Subtitle">
                <div className='Buttons'>
                    <h3>Equip</h3>
                </div>
            </div>
        </div>
    </div>
  );
}

export default Header;
